import React, { Component } from 'react';

class Header extends Component {
    render() {
        return (
            <div className="header-container">
                <div className="header-top">
                    <img src="src/assets/spotify_logo_green.png" />
                </div>  
            </div>
        );
    }
}

export default Header;
